function getUrlParam(name){var reg=new RegExp("(^|&)"+name+"=([^&]*)(&|$)");var r=window.location.search.substr(1).match(reg);if(r!=null)return decodeURI(r[2]);return null};function daysOld(DateOne,DateTwo){var OneMonth=DateOne.substring(5,DateOne.lastIndexOf('-'));var OneDay=DateOne.substring(DateOne.length,DateOne.lastIndexOf('-')+1);var OneYear=DateOne.substring(0,DateOne.indexOf('-'));var TwoMonth=DateTwo.substring(5,DateTwo.lastIndexOf('-'));var TwoDay=DateTwo.substring(DateTwo.length,DateTwo.lastIndexOf('-')+1);var TwoYear=DateTwo.substring(0,DateTwo.indexOf('-'));var cha=((Date.parse(TwoMonth+'/'+TwoDay+'/'+TwoYear)-Date.parse(OneMonth+'/'+OneDay+'/'+OneYear))/86400000);return cha};Date.prototype.format=function(format){var o={"M+":this.getMonth()+1,"d+":this.getDate(),"h+":this.getHours(),"m+":this.getMinutes(),"s+":this.getSeconds(),"q+":Math.floor((this.getMonth()+3)/3),"S":this.getMilliseconds()};if(/(y+)/.test(format)){format=format.replace(RegExp.$1,(this.getFullYear()+"").substr(4-RegExp.$1.length))};for(var k in o){if(new RegExp("("+k+")").test(format)){format=format.replace(RegExp.$1,RegExp.$1.length==1?o[k]:("00"+o[k]).substr((""+o[k]).length))}};return format};function getThisYear(){return new Date().format("yyyy")};function getLastYear(){return(parseInt(new Date().format("yyyy"))-1).toString()}